const queryNode = document.getElementById("query");
const displayNode = document.getElementById("display");
const sourceNode = document.getElementById("source");
const customNode = document.getElementById("custom");

sourceNode.value = 'zf';
let lines = buildLines(sourceNode.value);

function buildLines(source) {
    let lines = [];
    if (source === 'zf') {
        lines = zfSources;
    } else if (source === 'Lite XL') {
        lines = liteXLSources;
    } else if (source === 'Blender') {
        lines = blenderSources;
    } else {
        const str = customNode.value;
        lines = str.split(/\n/).map(l => l.trim()).filter(l => l);
    }

    return lines.map(line => ({
        rank: 0,
        str: line,
    }));
}

sourceNode.addEventListener("change", () => {
    const source = sourceNode.value;

    // show or hide the custom
    if (source === 'Custom...') {
        customNode.removeAttribute("hidden");
    } else {
        customNode.setAttribute('hidden', true);
    }

    lines = buildLines(source);
    run();
});

customNode.addEventListener("keyup", e => {
    lines = buildLines(sourceNode.value);
    run();
});

queryNode.addEventListener("keyup", run);

function run() {
    // clear contents
    displayNode.innerHTML = '';

    let query = queryNode.value.trim();

    // early exit if there is no query
    if (query === '') {
        return show(lines.slice(0, 10));
    }

    // smartcase only enables case sensitivity when at least one letter in the query is uppercase
    const case_sensitive = /[A-Z]/.test(query);

    const tokens = tokenize(query);

    // rank lines one token at a time
    const ranked = lines.filter(line => {
        const filename = line.str.split(/[\\/]/).pop();

        line.rank = 0.0;
        for (const token of tokens) {
            const r = rankToken(line.str, filename, token, case_sensitive, token.includes("/"));
            if (r === -1) {
                return false;
            }

            line.rank += r;
        }

        return true;
    }).sort((a, b) => a.rank - b.rank).slice(0, 10);

    show(ranked)
}

function show(lines) {
    for (let i = 0; i < 10; i++) {
        const li = document.createElement("li");
        // use a non-breaking space to maintain height of the "terminal"
        li.textContent = lines[i]?.str || "\u00A0";
        displayNode.appendChild(li);
    }
}

function tokenize(query) {
    return query.trim().split(/[ ]+/);
}

run();
